// ==UserScript==
// @name         Old Trakt Brand
// @description  RebrandTV. Return to the real logo of Trakt!
// @version      1.0.1
// @namespace    http://tampermonkey.net/
// @author       enzon19
// @match        https://trakt.tv/*
// @match        https://staging.trakt.tv/*
// @match        https://forums.trakt.tv/*
// @icon         https://raw.githubusercontent.com/enzon19/enzon19/refs/heads/main/assets/projects/trakt-tools/rebrandtv/logo.png
// @grant        GM_addStyle
// @license      CC BY
// @downloadURL https://update.greasyfork.org/scripts/513086/Old%20Trakt%20Brand.user.js
// @updateURL https://update.greasyfork.org/scripts/513086/Old%20Trakt%20Brand.meta.js
// ==/UserScript==

// ==Settings==
const continuousCheck = 0; // set a interval, in ms, to script continuously run — but can overload your browser
const removeNewCSS = false; // remove the new CSS to use the old one with a userstyle — this is good to apply better the old CSS, but can cause serious problems with new elements

// ==Assets==
const traktFavicon = "data:image/png;base64,";
const traktRedLogoWithoutText = "data:image/png;base64,"
const traktWhiteLogoWithoutText = "data:image/png;base64,";
const traktRedLogoWithText = "data:image/png;base64,"

const assets = [
    {
        description: "header logo",
        selector: ".logo-wrapper > a > img",
        property: "src",
        base64: traktRedLogoWithoutText
    },
    {
        description: "error page",
        selector: "#logo",
        property: "src",
        base64: traktRedLogoWithoutText
    },
    {
        description: "vip landing page",
        selector: ".trakt-logo",
        property: "src",
        base64: traktRedLogoWithoutText
    },
    {
        description: "forum header logo",
        selector: "#site-logo",
        property: "src",
        base64: traktRedLogoWithText
    },
    {
        description: "footer logo",
        selector: "footer > .copyright > .trakt > img",
        property: "src",
        base64: traktWhiteLogoWithoutText
    },
    {
        description: "vip logo",
        selector: ".label-vip > .trakt-logo",
        property: "src",
        base64: traktWhiteLogoWithoutText
    },
    {
        description: "home page trakt logo",
        selector: ".trakt-full > img",
        property: "src",
        base64: traktRedLogoWithText
    }
]

// ==Code==
function changeAssets(selector, base64Data, property = 'src') {
    const elements = document.querySelectorAll(selector);

    for (const element of elements) {
        element[property] = base64Data;
    }
}

function changeFavicon(newIconURL) {
    const iconSelectors = [
        "link[rel='icon']",
        "link[rel='apple-touch-icon']",
        "link[rel='shortcut icon']",
        "link[rel='mask-icon']",
        "link[rel='apple-touch-startup-image']"
    ];

    iconSelectors.forEach(selector => {
        let linkElements = document.querySelectorAll(selector);
        linkElements.forEach(link => {
            link.href = newIconURL;
        });
    });

    // Create a new icon link if it doesn't exist
    if (!document.querySelector("link[rel='icon']")) {
        let newLink = document.createElement('link');
        newLink.rel = 'icon';
        newLink.href = newIconURL;
        document.head.appendChild(newLink);
    }
}

function main() {
    console.log('applying: old trakt brand');

    changeFavicon(traktFavicon);

    for (const {selector, base64, property} of assets) {
        changeAssets(selector, base64, property);
    }

    // fix "check in" logo, placeholders and loading
    GM_addStyle(`
    :root {
        --trakt-placeholder-poster: url("data:image/png;base64,");
        --trakt-placeholder-screenshot: url("data:image/png;base64,");
        --trakt-placeholder-banner: url("data:image/png;base64,");
    }

    @font-face {
        font-family: trakt;
        src: url(https://raw.githubusercontent.com/StylusThemes/Trakt-Depurplify/main/assets/fonts/trakt.woff?rwqfl1) format("woff"), url(https://raw.githubusercontent.com/StylusThemes/Trakt-Depurplify/main/assets/fonts/trakt.ttf?rwqfl1) format("truetype");
        font-weight: 400;
        font-style: normal
    }

    #loading-bg > .logo > img,
    [src^="/assets/placeholders/thumb/poster"],
    [src^="/assets/placeholders/thumb/fanart"],
    [src^="/assets/placeholders/banner"] {
        visibility: hidden;
    }

    #loading-bg > .logo::before {
        content: "\\e600";
        font-family: 'trakt' !important;
        font-size: 60px;
    }

    .screenshot,
    .poster.screenshot,
    .thumb,
    [class^="fanart fanart"],
    [class="fanart"] {
        background-image: var(--trakt-placeholder-screenshot);
        background-size: cover;
        background-position: center;
    }

    .banner,
    .poster.banner {
        background-image: var(--trakt-placeholder-banner);
        background-size: cover;
        background-position: center;
    }

    .poster {
        background-image: var(--trakt-placeholder-poster);
        background-size: cover;
        background-position: center;
    }
}`
    )

    if (removeNewCSS) {
        const styleLink = Array.from(document.querySelectorAll('link[rel=stylesheet]')).find(e => e.href.includes('application'));
        if (styleLink) styleLink.remove();
    }
}

(() => {
    main();
    window.addEventListener('load', main);
    document.addEventListener('DOMContentLoaded', main);
    document.addEventListener('turbo:load', main);
    if (continuousCheck > 0) setInterval(main, continuousCheck);
})();